import React from 'react';
import { css } from 'emotion'


const MiddleHeader = () => {
    return(
        <div className={styles.data}></div>
    )
}

const styles = {
    data: css`
    position: absolute;
    width: 90%;
    height: 50px;
    background-color: black;
    top: 100%;
    `
}

export default MiddleHeader;
